import React from "react"
import { Col, Container, Row } from "reactstrap"
import logo from "../../assets/images/logo.png"
import "./footer.css"
import { Link } from "react-router-dom";


const quick__links=[
  {
    path:'/home',
    display:'Home'
  },
  {
    path:'/about',
    display:'About'
  },
  {
    path:'/tours',
    display:'Tours'
  },
 
];
const quick__links2=[
  {
    path:'/gallery',
    display:'Gallery'
  },
  {
    path:'/login',
    display:'Login'
  },
  {
    path:'/register',
    display:'Register'
  },
 
]




const Footer = () => {
  return (
   <footer className="footer">
   <Container>
     <Row>
     <Col lg="3">
     <div className="logo">
     <img src={logo} alt="" />
     <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Reprehenderit amet dignissimos reiciendis perspiciatis consequuntur in temporibus.</p>

     <div className="social__links d-flex align-items-center gap-4">
     <span>
       <Link to="#"></Link>
     </span>
     
     </div>
     </div>
     </Col>
     </Row>
   </Container>
   </footer>
  )
}

export default Footer
